const BellotaText300 = `@font-face { font-family: 'Bellota Text'; font-style: normal; font-weight: 300; src: local('Bellota Text Light'), local('BellotaText-Light'), url('data:font/woff2;base64,') format('woff2'); }`;
const BellotaText300italic = `@font-face { font-family: 'Bellota Text'; font-style: italic; font-weight: 300; src: local('Bellota Text Light Italic'), local('BellotaText-LightItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const BellotaTextRegular = `@font-face { font-family: 'Bellota Text'; font-style: normal; font-weight: 400; src: local('Bellota Text Regular'), local('BellotaText-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const BellotaTextItalic = `@font-face { font-family: 'Bellota Text'; font-style: italic; font-weight: 400; src: local('Bellota Text Italic'), local('BellotaText-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const BellotaText700 = `@font-face { font-family: 'Bellota Text'; font-style: normal; font-weight: 700; src: local('Bellota Text Bold'), local('BellotaText-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
const BellotaText700italic = `@font-face { font-family: 'Bellota Text'; font-style: italic; font-weight: 700; src: local('Bellota Text Bold Italic'), local('BellotaText-BoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
